import React, { Component } from 'react'
import axios from 'axios';
import Data from '/Data/cars.json'

export class Audi extends Component {

    state = {
        carsAudi : []
    }

    componentDidMoun() {
        axios.get(Data)
        .then(response => {
            console.log(response);
        })
    }

    render() {
        return (
            <div>
                <div className="container mt-5 pt-5">
                    <div className="row">   
                        <img className="col-lg-3 img-show-side" src="\Images\Logos\cmp\audi.png" alt="audi" /><div className="col-lg-9">Mercedes</div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Audi
